Продам две однокомнатные квартиры (спарку) в ЖК Валентиновская в одном тамбуре.
Уникальное предложение в данном ЖК!
Стандартный метраж 2-комнатной квартиры 63 м2. При покупке и объединение двух 1-комнатных квартир Вы приобретаете жилье площадью 79 м2 и возможность перепланировки жилья под собственный проект.

АО «Трест Жилстрой 1» самый надежный застройщик Харькова, который продолжает строить и восстанавливать дома даже в наше непростое время.

Квартиры находятся на 1 этаже 9-ти этажного дома. 
Не угловые/не торцевые.
При объединении квартир лоджия будет составлять 10 м2.

Квартиры в строительном состоянии, в комплектации:
- металлопластиковые окна,
- современные радиаторы отопления;
- горизонтальная разводка системы теплоснабжения (позволяет установить индивидуальные счетчики тепла);
- кирпичные межкомнатные перегородки (согласно проекта);
- металлическая дверь;
- электросчётчик и ввод электричества в квартиру;
- подводка водоснабжения и канализации в квартиру.
- пол первого этажа всегда утепляется застройщиком ЖС-1: 100мм утеплителя+черновая заливка пола;

Строительный номер дома 12. 
